import styled from "styled-components"

const Container = styled.div`

        height:100vh;
        width:100vw;
        background: linear-gradient(rgba(255,255,255,0.5),rgba(255,255,255,0.5)), url("https://images.pexels.com/photos/6984650/pexels-photo-6984650.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940")
      center;

        background-size: cover;

        display:flex;
        align-items:center;
        justify-content:center;
         


        `
const Wrapper = styled.div`

         width:25%;

        padding:20px;
        background-color:white;
       
`
const Title = styled.h1`

        font-size:24px;
        font-weight:500;
`
const Form = styled.form`

        display:flex;
        flex-direction:column;
`
const Input = styled.input`
        flex:1;
        min-width:40%;
        margin: 10px 0 ;
        padding:10px;

`

const Button = styled.button`
        width:30%;
        border:none;
        padding:10px 15px;
        background-color:teal;
        color:white;
        cursor:pointer;

        &:hover{
                background-color:gray;
                color:teal;
                
        }
`

const Link = styled.a`

        margin:5px 0;
        font-size:12px;
        font-weight:200;
        text-direction:underline;
        cursor:pointer;

`

const Login = () => {
    return (
        <Container>
        
            <Wrapper>
                <Title>Log In</Title>
                <Form>
                    <Input placeholder='Username' />
                    <Input placeholder='Password' />
                    <Button>Login</Button>
                    <Link>Forgotten Password?</Link>
                    <Link>Create A New Account</Link>
                </Form>
            </Wrapper>
        
        </Container>
    )
}

export default Login
